        const {items} = this.props;
        const theItems  = items.map(item=>{
 return(
<div>
    <div>{item.id}</div>
    <div>{item.name}</div>
    <div>{item.age}</div>
</div>
            );
        })
        return(
            <div>
   {theItems}
</div>
        );
    }
}
export default Items;
